measurements.description:
Eighty-seven flowers and six buds on three inflorescences,
    thirty-seven of the flowers and four of the buds on the longest inflorescence;
    sepals and petals light green, finely stippled dark rose centrally, coalescing distally;
    lip white, boldly spotted maroon, suffused rose distally;
    column cream, stippled light rose, coalesing dark rose distally, anther cap white;
    substance firm; texture matte.
